// ##################################################################
// ### SCL-90-R Logic                                             ###
// ##################################################################

// --- Skalendefinitionen und Hilfsfunktionen ---
const scales = {
    'Somatisierung': [1, 4, 12, 27, 40, 42, 48, 49, 52, 53, 56, 58],
    'Zwanghaftigkeit': [3, 9, 10, 28, 38, 45, 46, 51, 55, 65],
    'Unsicherheit im Sozialkontakt': [6, 21, 34, 36, 37, 41, 61, 69, 73],
    'Depressivität': [5, 14, 15, 20, 22, 26, 29, 30, 31, 32, 54, 71, 79],
    'Ängstlichkeit': [2, 17, 23, 33, 39, 57, 72, 78, 80, 86],
    'Aggressivität/Feindseligkeit': [11, 24, 63, 67, 74, 81],
    'Phobische Angst': [13, 25, 47, 50, 70, 75, 82],
    'Paranoides Denken': [8, 18, 43, 68, 76, 83],
    'Psychotizismus': [7, 16, 35, 62, 77, 84, 85, 87, 88, 90],
};

const getAgeCategory = (age) => {
    if (age >= 12 && age <= 14) return 1;
    if (age >= 15 && age <= 17) return 2;
    if (age >= 18 && age <= 29) return 3;
    if (age >= 30 && age <= 39) return 4;
    if (age >= 40 && age <= 49) return 5;
    if (age >= 50 && age <= 59) return 6;
    if (age >= 60 && age <= 69) return 7;
    if (age >= 70) return 8;
    return 3;
};

// --- Vollständige T-Wert-Funktionen ---
// ------ SKALA 1: SOMATISIERUNG ------
function T_Skala1(sw, kat, gesch) {
    let t_sw1 = 50; // Default
    if (gesch === 1) { // Männlich
        if (kat === 1) {
            if (sw <= 0) t_sw1 = 34; else if (sw === 1) t_sw1 = 40; else if (sw === 2) t_sw1 = 44; else if (sw === 3) t_sw1 = 48; else if (sw === 4) t_sw1 = 49; else if (sw === 5) t_sw1 = 52; else if (sw === 6) t_sw1 = 54; else if (sw === 7) t_sw1 = 55; else if (sw === 8) t_sw1 = 57; else if (sw === 9) t_sw1 = 59; else if (sw === 10) t_sw1 = 60; else if (sw === 11) t_sw1 = 62; else if (sw === 12) t_sw1 = 63; else if (sw === 13) t_sw1 = 64; else if (sw === 14) t_sw1 = 65; else if (sw === 15) t_sw1 = 66; else if (sw === 16) t_sw1 = 67; else if (sw >= 17 && sw <= 20) t_sw1 = 68; else if (sw === 21) t_sw1 = 69; else if (sw <= 23) t_sw1 = 70; else if (sw === 24) t_sw1 = 71; else if (sw === 25) t_sw1 = 73; else if (sw <= 29) t_sw1 = 75; else if (sw === 30) t_sw1 = 78; else if (sw >= 31) t_sw1 = 80;
        } else if (kat === 2) {
            if (sw <= 0) t_sw1 = 31; else if (sw === 1) t_sw1 = 38; else if (sw === 2) t_sw1 = 42; else if (sw === 3) t_sw1 = 45; else if (sw === 4) t_sw1 = 48; else if (sw === 5) t_sw1 = 50; else if (sw === 6) t_sw1 = 53; else if (sw === 7) t_sw1 = 55; else if (sw === 8) t_sw1 = 56; else if (sw === 9) t_sw1 = 58; else if (sw === 10) t_sw1 = 59; else if (sw === 11) t_sw1 = 60; else if (sw === 12) t_sw1 = 61; else if (sw === 13) t_sw1 = 62; else if (sw === 14) t_sw1 = 64; else if (sw === 15) t_sw1 = 65; else if (sw === 16) t_sw1 = 67; else if (sw === 17) t_sw1 = 70; else if (sw <= 19) t_sw1 = 71; else if (sw === 20) t_sw1 = 73; else if (sw <= 31) t_sw1 = 75; else if (sw === 32) t_sw1 = 77; else if (sw >= 33) t_sw1 = 80;
        } else if (kat === 3) {
                if (sw <= 0) t_sw1 = 38; else if (sw === 1) t_sw1 = 45; else if (sw === 2) t_sw1 = 50; else if (sw === 3) t_sw1 = 52; else if (sw === 4) t_sw1 = 55; else if (sw === 5) t_sw1 = 57; else if (sw === 6) t_sw1 = 59; else if (sw === 7) t_sw1 = 60; else if (sw === 8) t_sw1 = 61; else if (sw === 9) t_sw1 = 63; else if (sw === 10) t_sw1 = 64; else if (sw === 11) t_sw1 = 65; else if (sw === 12) t_sw1 = 67; else if (sw === 13) t_sw1 = 69; else if (sw === 14) t_sw1 = 71; else if (sw === 15) t_sw1 = 71; else if (sw === 16) t_sw1 = 73; else if (sw <= 22) t_sw1 = 74; else if (sw === 23) t_sw1 = 75; else if (sw === 24) t_sw1 = 78; else if (sw >= 25) t_sw1 = 80;
        } else if (kat === 4) {
            if (sw <= 0) t_sw1 = 37; else if (sw === 1) t_sw1 = 44; else if (sw === 2) t_sw1 = 48; else if (sw === 3) t_sw1 = 51; else if (sw === 4) t_sw1 = 53; else if (sw === 5) t_sw1 = 55; else if (sw === 6) t_sw1 = 56; else if (sw === 7) t_sw1 = 59; else if (sw === 8) t_sw1 = 61; else if (sw === 9) t_sw1 = 64; else if (sw === 10) t_sw1 = 66; else if (sw === 11) t_sw1 = 67; else if (sw === 12) t_sw1 = 67; else if (sw === 13) t_sw1 = 68; else if (sw === 14) t_sw1 = 69; else if (sw <= 20) t_sw1 = 71; else if (sw === 21) t_sw1 = 72; else if (sw <= 24) t_sw1 = 73; else if (sw === 25) t_sw1 = 74; else if (sw === 26) t_sw1 = 75; else if (sw === 27) t_sw1 = 78; else if (sw >= 28) t_sw1 = 80;
        } else if (kat === 5) {
            if (sw <= 0) t_sw1 = 35; else if (sw === 1) t_sw1 = 42; else if (sw === 2) t_sw1 = 46; else if (sw === 3) t_sw1 = 49; else if (sw === 4) t_sw1 = 52; else if (sw === 5) t_sw1 = 55; else if (sw === 6) t_sw1 = 58; else if (sw === 7) t_sw1 = 59; else if (sw === 8) t_sw1 = 61; else if (sw === 9) t_sw1 = 62; else if (sw === 10) t_sw1 = 63; else if (sw === 11) t_sw1 = 63; else if (sw === 12) t_sw1 = 65; else if (sw === 13) t_sw1 = 67; else if (sw === 14) t_sw1 = 68; else if (sw <= 17) t_sw1 = 69; else if (sw === 18) t_sw1 = 70; else if (sw <= 23) t_sw1 = 71; else if (sw === 24) t_sw1 = 73; else if (sw <= 34) t_sw1 = 75; else if (sw === 35) t_sw1 = 77; else if (sw >= 36) t_sw1 = 80;
        } else if (kat === 6) {
            if (sw <= 0) t_sw1 = 36; else if (sw === 1) t_sw1 = 42; else if (sw === 2) t_sw1 = 46; else if (sw === 3) t_sw1 = 49; else if (sw === 4) t_sw1 = 52; else if (sw === 5) t_sw1 = 54; else if (sw === 6) t_sw1 = 56; else if (sw === 7) t_sw1 = 57; else if (sw === 8) t_sw1 = 59; else if (sw === 9) t_sw1 = 60; else if (sw === 10) t_sw1 = 61; else if (sw === 11) t_sw1 = 63; else if (sw === 12) t_sw1 = 64; else if (sw === 13) t_sw1 = 65; else if (sw === 14) t_sw1 = 66; else if (sw === 15) t_sw1 = 67; else if (sw === 16) t_sw1 = 69; else if (sw <= 19) t_sw1 = 71; else if (sw === 20) t_sw1 = 73; else if (sw === 21) t_sw1 = 76; else if (sw >= 22) t_sw1 = 80;
        } else if (kat === 7) {
            if (sw <= 0) t_sw1 = 32; else if (sw === 1) t_sw1 = 38; else if (sw === 2) t_sw1 = 42; else if (sw === 3) t_sw1 = 45; else if (sw === 4) t_sw1 = 48; else if (sw === 5) t_sw1 = 50; else if (sw === 6) t_sw1 = 52; else if (sw === 7) t_sw1 = 54; else if (sw === 8) t_sw1 = 57; else if (sw === 9) t_sw1 = 59; else if (sw === 10) t_sw1 = 61; else if (sw === 11) t_sw1 = 62; else if (sw === 12) t_sw1 = 63; else if (sw === 13) t_sw1 = 64; else if (sw === 14) t_sw1 = 65; else if (sw === 15) t_sw1 = 65; else if (sw <= 17) t_sw1 = 66; else if (sw <= 19) t_sw1 = 67; else if (sw <= 21) t_sw1 = 68; else if (sw === 22) t_sw1 = 70; else if (sw <= 24) t_sw1 = 71; else if (sw === 25) t_sw1 = 72; else if (sw === 26) t_sw1 = 73; else if (sw === 27) t_sw1 = 75; else if (sw === 28) t_sw1 = 77; else if (sw >= 29) t_sw1 = 80;
        } else if (kat === 8) {
            if (sw <= 0) t_sw1 = 35; else if (sw === 1) t_sw1 = 41; else if (sw === 2) t_sw1 = 44; else if (sw === 3) t_sw1 = 46; else if (sw === 4) t_sw1 = 48; else if (sw === 5) t_sw1 = 50; else if (sw === 6) t_sw1 = 52; else if (sw === 7) t_sw1 = 53; else if (sw === 8) t_sw1 = 55; else if (sw === 9) t_sw1 = 55; else if (sw === 10) t_sw1 = 56; else if (sw === 11) t_sw1 = 57; else if (sw === 12) t_sw1 = 58; else if (sw === 13) t_sw1 = 59; else if (sw === 14) t_sw1 = 61; else if (sw === 15) t_sw1 = 64; else if (sw <= 17) t_sw1 = 66; else if (sw === 18) t_sw1 = 67; else if (sw <= 23) t_sw1 = 68; else if (sw === 24) t_sw1 = 70; else if (sw === 25) t_sw1 = 74; else if (sw >= 26) t_sw1 = 80;
        }
    } else { // Weiblich
        if (kat === 1) {
