                if (pst <= 6) t_pst = 27; else if (pst === 7) t_pst = 31; else if (pst === 8) t_pst = 33; else if (pst === 9) t_pst = 34; else if (pst === 10) t_pst = 35; else if (pst === 11) t_pst = 36; else if (pst <= 13) t_pst = 37; else if (pst <= 15) t_pst = 38; else if (pst <= 17) t_pst = 39; else if (pst === 18) t_pst = 40; else if (pst <= 20) t_pst = 41; else if (pst <= 22) t_pst = 42; else if (pst === 23) t_pst = 43; else if (pst <= 25) t_pst = 44; else if (pst <= 27) t_pst = 45; else if (pst <= 29) t_pst = 46; else if (pst <= 31) t_pst = 48; else if (pst <= 33) t_pst = 49; else if (pst <= 36) t_pst = 50; else if (pst === 37) t_pst = 51; else if (pst <= 39) t_pst = 52; else if (pst <= 46) t_pst = 53; else if (pst <= 49) t_pst = 54; else if (pst <= 51) t_pst = 55; else if (pst <= 54) t_pst = 56; else if (pst <= 57) t_pst = 57; else if (pst <= 59) t_pst = 58; else if (pst <= 62) t_pst = 59; else if (pst === 63) t_pst = 60; else if (pst === 64) t_pst = 61; else if (pst <= 67) t_pst = 62; else if (pst === 68) t_pst = 63; else if (pst === 69) t_pst = 64; else if (pst === 70) t_pst = 65; else if (pst === 71) t_pst = 67; else if (pst === 72) t_pst = 68; else if (pst <= 79) t_pst = 69; else if (pst === 80) t_pst = 70; else if (pst === 81) t_pst = 72; else if (pst >= 82) t_pst = 73;
            }
        }
    return t_pst;
}



const SCL90RComponent = ({ patient, onSaveResult, onDeleteResult }) => {
    const [age, setAge] = useState('');
    const [gender, setGender] = useState('1'); 
    const [itemScores, setItemScores] = useState(Array(90).fill(''));
    const [results, setResults] = useState(null);
    const [error, setError] = useState('');

    useEffect(() => {
        resetForm();
    }, [patient]);

    const handleItemChange = (index, value) => {
        const newScores = [...itemScores];
        if (/^[0-4]?$/.test(value)) {
            newScores[index] = value;
            setItemScores(newScores);
        }
    };

    const resetForm = () => {
        setAge('');
        setGender('1');
        setItemScores(Array(90).fill(''));
        setResults(null);
        setError('');
    };

    const calculateResults = () => {
        setError('');
        const parsedAge = parseInt(age, 10);
        if (isNaN(parsedAge) || parsedAge <= 0) {
            setError('Bitte geben Sie ein gültiges Alter an.');
            return;
        }

        try {
            const parsedItemScores = itemScores.map((score, index) => {
                const val = parseInt(score, 10);
                if (isNaN(val) || val < 0 || val > 4) {
                    throw new Error(`Ungültiger Wert für Item ${index + 1}. Bitte geben Sie eine Zahl zwischen 0 und 4 ein.`);
                }
                return val;
            });

            const kategorie = getAgeCategory(parsedAge);
            const parsedGender = parseInt(gender, 10);

            const rawScores = {};
            for (const scaleName in scales) {
                rawScores[scaleName] = scales[scaleName].reduce((sum, itemNum) => sum + (parsedItemScores[itemNum - 1] || 0), 0);
            }

            let totalSum = parsedItemScores.reduce((sum, score) => sum + score, 0);
            let positiveSymptomTotal = parsedItemScores.filter(score => score > 0).length;

            const gsi = totalSum / 90;
            const pst = positiveSymptomTotal;
            const psdi = pst > 0 ? totalSum / pst : 0;

            const tScores = {
                'Somatisierung': T_Skala1(rawScores['Somatisierung'], kategorie, parsedGender),
                'Zwanghaftigkeit': T_Skala2(rawScores['Zwanghaftigkeit'], kategorie, parsedGender),
                'Unsicherheit im Sozialkontakt': T_Skala3(rawScores['Unsicherheit im Sozialkontakt'], kategorie, parsedGender),
                'Depressivität': T_Skala4(rawScores['Depressivität'], kategorie, parsedGender),
                'Ängstlichkeit': T_Skala5(rawScores['Ängstlichkeit'], kategorie, parsedGender),
                'Aggressivität/Feindseligkeit': T_Skala6(rawScores['Aggressivität/Feindseligkeit'], kategorie, parsedGender),
                'Phobische Angst': T_Skala7(rawScores['Phobische Angst'], kategorie, parsedGender),
                'Paranoides Denken': T_Skala8(rawScores['Paranoides Denken'], kategorie, parsedGender),
                'Psychotizismus': T_Skala9(rawScores['Psychotizismus'], kategorie, parsedGender),
                'GSI': T_GSI(gsi, kategorie, parsedGender),
                'PSDI': T_PSDI(psdi, kategorie, parsedGender),
                'PST': T_PST(pst, kategorie, parsedGender),
            };

            let interpretationText = "";
            const interpretations = {
                'Somatisierung': 'erfasst die Belastung durch wahrgenommene körperliche Dysfunktionen.',
                'Zwanghaftigkeit': 'bezieht sich auf Gedanken und Handlungen, die als zwanghaft und unerwünscht erlebt werden.',
                'Unsicherheit im Sozialkontakt': 'misst Gefühle von persönlicher Unzulänglichkeit und Unbehagen in sozialen Situationen.',
                'Depressivität': 'umfasst zentrale Symptome eines depressiven Syndroms wie Anhedonie, Hoffnungslosigkeit und Suizidgedanken.',
                'Ängstlichkeit': 'deckt Symptome wie Nervosität, Anspannung und Panikattacken ab.',
                'Aggressivität/Feindseligkeit': 'erfasst Gedanken, Gefühle und Verhaltensweisen, die mit Ärger und Feindseligkeit verbunden sind.',
                'Phobische Angst': 'beschreibt eine anhaltende und unangemessene Angstreaktion auf spezifische Personen, Orte, Objekte oder Situationen.',
                'Paranoides Denken': 'beinhaltet misstrauisches Denken, Projektion und die Angst vor Autonomieverlust.',
                'Psychotizismus': 'umfasst einen Bereich von Symptomen, die von sozialer Isolation bis hin zu Anzeichen einer Schizophrenie reichen.',
                'GSI': 'ist der wichtigste globale Kennwert und gibt das Ausmaß der allgemeinen psychischen Belastung an.'
            };

            let hasSignificantScores = false;
            for (const scale in interpretations) {
                if(tScores[scale] && tScores[scale] >= 63) {
                    hasSignificantScores = true;
                    interpretationText += `\n- ${scale}: Ein T-Wert von ${tScores[scale]} ist klinisch auffällig und deutet auf eine signifikante Belastung hin. Diese Skala ${interpretations[scale]}`;
                }
            }
            if(!hasSignificantScores) {
                interpretationText = "Keine klinisch auffälligen Werte (T-Wert < 63) auf den ausgewerteten Hauptskalen.";
            }

            setResults({ rawScores, tScores, globalScores: { gsi, psdi, pst }, interpretation: interpretationText });

        } catch (e) {
            setError(e.message);
        }
    };

    const handleSave = () => {
        if(results) {
            onSaveResult(results);
            alert("Ergebnis gespeichert!");
        } else {
            setError("Bitte berechnen Sie zuerst die Auswertung.");
        }
    };

    return (
        <div>
            <h4 className="text-xl font-semibold text-gray-700 mb-4">SCL-90-R Erfassung & Auswertung</h4>

            <div className="bg-white p-6 rounded-2xl shadow-lg mb-8">
                <h2 className="text-2xl font-semibold mb-4 text-gray-800 border-b pb-2">Patientendaten & Items</h2>
                <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">
                    <div>
                        <label htmlFor="scl-age" className="block text-sm font-medium text-gray-700 mb-1">Alter</label>
                        <input type="number" id="scl-age" value={age} onChange={(e) => setAge(e.target.value)} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-3" placeholder="z.B. 35" />
                    </div>
                    <div>
                        <label htmlFor="scl-gender" className="block text-sm font-medium text-gray-700 mb-1">Geschlecht</label>
                        <select id="scl-gender" value={gender} onChange={(e) => setGender(e.target.value)} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-2">
                            <option value="1">Männlich</option>
                            <option value="2">Weiblich</option>
                        </select>
                    </div>
                </div>

                <div className="grid grid-cols-5 md:grid-cols-10 gap-x-4 gap-y-2">
                    {itemScores.map((score, index) => (
                        <div key={index} className="flex flex-col">
                            <label htmlFor={`item-${index}`} className="mb-1 text-xs font-medium text-gray-600">Item {index + 1}</label>
                            <input type="number" id={`item-${index}`} value={score} onChange={(e) => handleItemChange(index, e.target.value)} min="0" max="4" className="w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-2 text-center"/>
                        </div>
                    ))}
                </div>
            </div>

            <div className="flex flex-col sm:flex-row justify-center items-center gap-4 mb-8">
                <button onClick={calculateResults} className="w-full sm:w-auto bg-indigo-600 text-white font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 transition-transform transform hover:scale-105 flex items-center justify-center">
                    <CalculateIcon /> Auswerten
                </button>
                <button onClick={resetForm} className="w-full sm:w-auto bg-gray-200 text-gray-700 font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-gray-300 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-400 transition-transform transform hover:scale-105 flex items-center justify-center">
                    <ResetIcon /> Zurücksetzen
                </button>
                {results && (
                     <button onClick={handleSave} className="w-full sm:w-auto bg-green-600 text-white font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500 transition-transform transform hover:scale-105 flex items-center justify-center">
                        <SaveIcon /> Ergebnis Speichern
                    </button>
                )}
            </div>

            {error && <p className="bg-red-100 text-red-700 p-3 rounded-md mb-4 text-sm">{error}</p>}

            {results && (
                 <div className="bg-white p-6 rounded-2xl shadow-lg">
                    <h2 className="text-2xl font-semibold mb-6 text-gray-800 border-b pb-3">Ergebnisse</h2>
                     <div className="mt-8">
                        <h3 className="text-xl font-semibold mb-4 text-gray-700">Kurz-Interpretation</h3>
                        <div className="space-y-4 text-gray-700 whitespace-pre-wrap">{results.interpretation}</div>
                    </div>
                 </div>
            )}

            <div className="mt-8">
                <h3 className="text-xl font-semibold mb-4 text-gray-700">Protokollierte SCL-90-R Ergebnisse</h3>
                 {(patient.scl90rResults || []).length === 0 ? (
                    <p className="text-sm text-gray-500">Keine SCL-90-R Ergebnisse für diesen Patienten erfasst.</p>
                ) : (
                    <ul className="space-y-2">
                        {(patient.scl90rResults || []).map((result, index) => (
                            <li key={index} className="bg-white p-3 rounded-md shadow-sm border flex justify-between items-center">
                                <div>
                                    <span className="font-medium text-indigo-600">Datum: {new Date(result.date).toLocaleDateString('de-DE')}</span>
                                    <span className="ml-4 text-sm text-gray-600">GSI T-Wert: <span className="font-bold">{result.tScores?.GSI || 'N/A'}</span></span>
                                </div>
                                <button onClick={() => onDeleteResult(result.date)} className="text-red-500 hover:text-red-700 transition duration-150 p-1 rounded hover:bg-red-100" title="Dieses Ergebnis löschen">
                                    <Trash2 className="w-5 h-5" />
                                </button>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
        </div>
    );
};

export default SCL90RComponent;
